-- Table structure for `client_session`
-- ----------------------------
DROP TABLE IF EXISTS `client_session`;
CREATE TABLE `client_session` (
  `session_id` int(11) NOT NULL AUTO_INCREMENT,
  `pro_id` int(11) NOT NULL COMMENT '项目ID',
  `app_name` varchar(50) DEFAULT NULL,
  `app_id` varchar(50) DEFAULT NULL COMMENT '应用ID标识',
  `app_path` varchar(255) DEFAULT NULL COMMENT '应用路径',
  `version_id` int(11) DEFAULT NULL COMMENT '客户端版 本ID',
  `version_name` varchar(50) DEFAULT NULL COMMENT '版本名称',
  `gateway_ip` varchar(30) DEFAULT NULL COMMENT '网关IP',
  `client_ip` varchar(255) DEFAULT NULL COMMENT '客户端IP',
  `client_mac_address` varchar(255) DEFAULT NULL COMMENT '客户端MAC地址',
  `heartbeat` int(11) DEFAULT NULL COMMENT '心跳计数',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录最后修改时间',
  `disable` bit(1) NOT NULL DEFAULT b'1' COMMENT '记录是否有效 1 有效 0逻辑删除',
  PRIMARY KEY (`session_id`)
