-- ----------------------------
-- Table structure for `client_update_log`
-- ----------------------------
DROP TABLE IF EXISTS `client_update_log`;
CREATE TABLE `client_update_log` (
  `log_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '日志ID 主键 ',
  `pro_id` int(11) NOT NULL COMMENT '项目ID',
  `app_name` varchar(50) DEFAULT NULL COMMENT 'app名称',
  `client_id` int(11) NOT NULL COMMENT '客户端ID',
  `previous_version_name` varchar(30) DEFAULT NULL COMMENT '上一版本名称',
  `version_id` int(11) NOT NULL COMMENT '当前版本ID',
  `version_name` varchar(50) NOT NULL COMMENT '当前版本名称',
  `version_md5` varchar(32) NOT NULL COMMENT '当前版本MD5',
  `version_size` int(10) NOT NULL COMMENT '当前版本大小',
  `gateway_ip` varchar(30) DEFAULT NULL COMMENT '客户网关IP',
  `client_ip` varchar(30) DEFAULT NULL COMMENT '客户端IP',
  `client_mac_address` varchar(50) DEFAULT NULL COMMENT '客户机MAC地址',
  `client_platform` enum('java','Ruby','Node','Python','NET','php') DEFAULT NULL COMMENT '客户端 平台',
  `surroundings` tinytext COMMENT '客户端环境信息 json 格式',
  `begin_time` datetime DEFAULT NULL COMMENT '更新开始时间 ，此为客户机上的时间',
  `consume_time` int(6) DEFAULT NULL COMMENT '更新用时(秒)',
  `state` enum('fail','success','start') NOT NULL DEFAULT 'start',
  `fail_message` tinytext COMMENT '更新异常信息',
  `update_url` varchar(255) NOT NULL COMMENT '更新地址',
  `create_time` datetime NOT NULL COMMENT '记录创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录最后更新时间',
  `disable` bit(1) NOT NULL DEFAULT b'1' COMMENT '记录是否有效 1 有效 0逻辑删除',
  PRIMARY KEY (`log_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

