-- ----------------------------
-- Table structure for `project`
-- ----------------------------
DROP TABLE IF EXISTS `project`;
CREATE TABLE `project` (
  `pro_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '项目ID',
  `name` varchar(50) NOT NULL COMMENT '项目名称',
  `pro_key` varchar(32) NOT NULL COMMENT '项目key',
  `pro_secret` varchar(32) NOT NULL COMMENT '项目密钥',
  `describes` varchar(255) DEFAULT NULL COMMENT '项目描述',
  `belongs_way` enum('team','personal') DEFAULT NULL COMMENT '归属方式：个人、团队',
  `belongs_id` int(11) DEFAULT NULL COMMENT '项目归属方ID， 个人user_id 和团队team_id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `disable` bit(1) NOT NULL DEFAULT b'1' COMMENT '记录是否有效 1 有效 0无效即逻辑删除',
  PRIMARY KEY (`pro_id`),
  UNIQUE KEY `pro_key` (`pro_key`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of project
-- ----------------------------

-- ----------------------------
-- Table structure for `project_app`
-- ----------------------------
DROP TABLE IF EXISTS `project_app`;
CREATE TABLE `project_app` (
  `app_id` int(11) NOT NULL AUTO_INCREMENT,
  `pro_id` int(11) NOT NULL,
  `app_name` varchar(50) DEFAULT NULL COMMENT 'app名称',
  `root_name` varchar(50) DEFAULT NULL COMMENT '应用工程名称 或应用的部署名称',
  `namespace` varchar(100) DEFAULT NULL COMMENT '命名空间，必须指定该应用下的一个包路径作为值，目的是区分同项目下其它应用',
  `inside_packages` text COMMENT '内部包名。以'';''符号进行分割 ',
  `relys_lib` text COMMENT '依懒的外部资源 以'';''符号进行分割',
  `platform` enum('java') NOT NULL,
  `classify` varchar(255) DEFAULT NULL COMMENT '应用分类 ',
  `configs_json` text COMMENT '应用配置信息',
  `describes` varchar(255) DEFAULT NULL COMMENT '应用描述',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT '2018-06-19 17:42:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `disable` bit(1) NOT NULL DEFAULT b'1' COMMENT '记录是否有效 1 有效 0无效',
  PRIMARY KEY (`app_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of project_app
-- ----------------------------

-- ----------------------------
-- Table structure for `project_config`
-- ----------------------------
DROP TABLE IF EXISTS `project_config`;
CREATE TABLE `project_config` (
  `config_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '配置ID',
  `project_id` int(11) DEFAULT NULL COMMENT '项目ID 等于0表所有项目',
  `app_id` int(11) NOT NULL COMMENT '应用ID',
  `dynamic` bit(1) NOT NULL COMMENT '是否为动态的',
  `config_key` varchar(100) NOT NULL COMMENT '配置名称',
  `config_value` tinytext COMMENT '配置值',
  `value_type` enum('string','number','boolean','text') DEFAULT NULL COMMENT '值类型约束',
  `describes` varchar(255) DEFAULT NULL COMMENT '配置描述 ',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`config_id`),
  UNIQUE KEY `key_unique` (`project_id`,`app_id`,`config_key`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='项目配置信息';

-- ----------------------------
-- Records of project_config
-- ----------------------------

