-- Table structure for `project_member`
-- ----------------------------
DROP TABLE IF EXISTS `project_member`;
CREATE TABLE `project_member` (
  `member_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '成员ID 主键自动',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `pro_id` int(11) NOT NULL COMMENT '项目ID',
  `role` enum('master','manager','general','confine') NOT NULL COMMENT '角色：master、管理员、普通成员、受限成员',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `disable` bit(1) NOT NULL DEFAULT b'1' COMMENT '记录是否有效：1有效 、0逻辑删除',
