-- ----------------------------
-- Table structure for `static_properties`
-- ----------------------------
DROP TABLE IF EXISTS `static_properties`;
CREATE TABLE `static_properties` (
  `static_id` int(11) NOT NULL COMMENT '主键ID',
  `static_key` varchar(50) NOT NULL COMMENT '静态key 与history 组成唯一索引',
  `static_value` varchar(100) DEFAULT NULL COMMENT '普通属性值',
  `static_text` text COMMENT '大属性文本',
  `history` int(2) NOT NULL DEFAULT '0' COMMENT '历史版本记录',
  `last_updat_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `remarks` varchar(50) DEFAULT NULL COMMENT '属性描述 或备注',
  `type` int(2) DEFAULT NULL,
  `disable` bit(1) DEFAULT NULL,
  PRIMARY KEY (`static_id`),
  UNIQUE KEY `static_properties_static_key_history_uindex` (`static_key`,`history`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='静态属性表';

