-- ----------------------------
-- Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(20) NOT NULL COMMENT '用户帐户名称 ',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱地址',
  `mobile_phone` varchar(20) DEFAULT NULL COMMENT '移动电话',
  `nickname` varchar(50) NOT NULL COMMENT '用户昵称',
  `login_password` varchar(50) NOT NULL COMMENT '登陆密码 MD5 密文',
  `weixin` varchar(30) DEFAULT NULL COMMENT '微信号',
  `qq` varchar(30) DEFAULT NULL COMMENT 'qq号',
  `province` varchar(20) DEFAULT NULL COMMENT '所在地区省',
  `city` varchar(20) DEFAULT NULL COMMENT '所在地区城市',
  `profession` varchar(20) DEFAULT NULL COMMENT '职业',
  `organization` varchar(20) DEFAULT NULL COMMENT '所在公司组织',
  `department` varchar(20) DEFAULT NULL COMMENT '部门',
  `create_time` datetime NOT NULL COMMENT '记录创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录最后更新时间',
  `disable` bit(1) NOT NULL DEFAULT b'1' COMMENT '记录是否有效 1 有效 0 无效',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_name` (`user_name`) USING BTREE,
  UNIQUE KEY `email` (`email`) USING BTREE,
  UNIQUE KEY `mobile_phone` (`mobile_phone`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

